import { motion } from "framer-motion";
import React from "react";
import { Link } from "react-router-dom";
import "./LandingPage.css";

const LandingPage = () => {
  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: { staggerChildren: 0.2, delayChildren: 0.3 }
    }
  };

  const itemVariants = {
    hidden: { y: 30, opacity: 0 },
    visible: { 
      y: 0, 
      opacity: 1, 
      transition: { 
        duration: 0.8,
        ease: [0.6, -0.05, 0.01, 0.99]
      } 
    }
  };

  const features = [
    {
      icon: "üìä",
      title: "Interactive Learning",
      description: "Hands-on projects with real-world datasets"
    },
    {
      icon: "üéØ",
      title: "Personalized Paths",
      description: "Customized journeys based on your goals"
    },
    {
      icon: "üèÜ",
      title: "Certification",
      description: "Earn recognized certificates"
    },
    {
      icon: "ü§ù",
      title: "Community",
      description: "Connect with peers and experts"
    }
  ];

  return (
    <div className="landing-page">
      {/* Hero Section */}
      <section className="hero-section">
        <div className="hero-background">
          <div className="gradient-circle blue"></div>
          <div className="gradient-circle teal"></div>
          <div className="gradient-circle purple"></div>
        </div>

        <motion.div 
          className="hero-content"
          initial="hidden"
          animate="visible"
          variants={containerVariants}
        >
          <motion.div variants={itemVariants} className="badge">
            <span>New</span> Updated for 2024
          </motion.div>

          <motion.h1 variants={itemVariants} className="hero-title">
            Unlock Your <span>Data Science</span> Journey
          </motion.h1>

          <motion.p variants={itemVariants} className="hero-subtitle">
            Learn the right skills, in the right order. Track progress, practice with hands‚Äëon projects, 
            and land your dream role.
          </motion.p>

          <motion.div variants={itemVariants} className="hero-cta">
            <Link to="/signup" className="primary-button">Get Started</Link>
            <a href="#features" className="secondary-button">
              <svg width="20" height="20" viewBox="0 0 24 24" fill="none">
                <path d="M12 22C17.5228 22 22 17.5228 22 12C22 6.47715 17.5228 2 12 2C6.47715 2 2 6.47715 2 12C2 17.5228 6.47715 22 12 22Z" stroke="currentColor" strokeWidth="2"/>
                <path d="M10 8L16 12L10 16V8Z" stroke="currentColor" strokeWidth="2"/>
              </svg>
              View Features
            </a>
          </motion.div>

          <motion.div variants={itemVariants} className="hero-stats">
            <div className="stat-card">
              <span className="stat-value">10k+</span>
              <span className="stat-label">Learners</span>
            </div>
            <div className="stat-card">
              <span className="stat-value">120+</span>
              <span className="stat-label">Topics</span>
            </div>
            <div className="stat-card">
              <span className="stat-value">40+</span>
              <span className="stat-label">Projects</span>
            </div>
          </motion.div>
        </motion.div>

        <div className="hero-visual">
          <div className="data-visualization">
            <div className="chart-container">
              <motion.div 
                className="chart-bar" 
                style={{ background: 'linear-gradient(to top, #6366f1, #8b5cf6)' }}
                animate={{ height: ['70%', '85%', '70%'] }}
                transition={{ duration: 4, repeat: Infinity }}
              />
              <motion.div 
                className="chart-bar" 
                style={{ background: 'linear-gradient(to top, #06b6d4, #0ea5e9)' }}
                animate={{ height: ['50%', '65%', '50%'] }}
                transition={{ duration: 5, repeat: Infinity, delay: 0.5 }}
              />
              <motion.div 
                className="chart-bar" 
                style={{ background: 'linear-gradient(to top, #ec4899, #f43f5e)' }}
                animate={{ height: ['90%', '75%', '90%'] }}
                transition={{ duration: 3.5, repeat: Infinity, delay: 1 }}
              />
              <motion.div 
                className="chart-bar" 
                style={{ background: 'linear-gradient(to top, #f59e0b, #f97316)' }}
                animate={{ height: ['40%', '55%', '40%'] }}
                transition={{ duration: 4.5, repeat: Infinity, delay: 0.8 }}
              />
            </div>
            <div className="chart-labels">
              <span>Python</span>
              <span>SQL</span>
              <span>ML</span>
              <span>Stats</span>
            </div>
          </div>
        </div>
      </section>

      {/* Features Section */}
      <section id="features" className="features-section">
        <div className="section-container">
          <motion.h2 
            className="section-title"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            Why Learn With Us
          </motion.h2>
          <motion.p 
            className="section-subtitle"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.1 }}
            viewport={{ once: true }}
          >
            We combine the best of structured education with practical applications
          </motion.p>

          <motion.div 
            className="features-grid"
            initial="hidden"
            whileInView="visible"
            variants={containerVariants}
            viewport={{ once: true }}
          >
            {features.map((feature, index) => (
              <motion.div 
                key={index} 
                className="feature-card"
                variants={itemVariants}
                whileHover={{ y: -8 }}
              >
                <div className="feature-icon">{feature.icon}</div>
                <h3 className="feature-title">{feature.title}</h3>
                <p className="feature-description">{feature.description}</p>
              </motion.div>
            ))}
          </motion.div>
        </div>
      </section>

      {/* About Section */}
      <section id="about" className="about-section">
        <div className="section-container">
          <motion.div 
            className="about-content"
            initial={{ opacity: 0, x: -30 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <h2>About the Platform</h2>
            <p>
              We help learners master data science with practical, curated paths. Progress tracking, 
              hands‚Äëon projects, and community support keep you motivated from fundamentals to 
              advanced topics.
            </p>
            <Link to="/home" className="outline-button">
              Explore Learning Paths
            </Link>
          </motion.div>

          <motion.div 
            className="about-visual"
            initial={{ opacity: 0, x: 30 }}
            whileInView={{ opacity: 1, x: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <div className="floating-cards">
              <motion.div 
                className="floating-card card1"
                animate={{ y: [0, 15, 0] }}
                transition={{ duration: 6, repeat: Infinity }}
              />
              <motion.div 
                className="floating-card card2"
                animate={{ y: [0, -10, 0] }}
                transition={{ duration: 5, repeat: Infinity, delay: 1 }}
              />
              <motion.div 
                className="floating-card card3"
                animate={{ y: [0, 20, 0] }}
                transition={{ duration: 7, repeat: Infinity, delay: 0.5 }}
              />
            </div>
          </motion.div>
        </div>
      </section>

      {/* Pricing Section */}
      <section id="pricing" className="pricing-section">
        <div className="section-container">
          <motion.h2 
            className="section-title"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            Simple, Transparent Pricing
          </motion.h2>
          <motion.p 
            className="section-subtitle"
            initial={{ opacity: 0, y: 20 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.6, delay: 0.1 }}
            viewport={{ once: true }}
          >
            Choose the plan that fits your learning goals
          </motion.p>

          <motion.div 
            className="pricing-grid"
            initial="hidden"
            whileInView="visible"
            variants={containerVariants}
            viewport={{ once: true }}
          >
            <motion.div variants={itemVariants} className="pricing-card">
              <h3>Free</h3>
              <div className="price">$0<span>/month</span></div>
              <p>Explore basics with limited access</p>
              <ul>
                <li>Community access</li>
                <li>Intro courses</li>
                <li>Basic projects</li>
              </ul>
              <Link to="/signup" className="secondary-button">Get Started</Link>
            </motion.div>

            <motion.div variants={itemVariants} className="pricing-card popular">
              <div className="badge">Popular</div>
              <h3>Pro</h3>
              <div className="price">$29<span>/month</span></div>
              <p>Full paths, projects, and certificates</p>
              <ul>
                <li>All learning paths</li>
                <li>Capstone projects</li>
                <li>Completion certificates</li>
                <li>Priority support</li>
              </ul>
              <Link to="/signup" className="primary-button">Go Pro</Link>
            </motion.div>

            <motion.div variants={itemVariants} className="pricing-card">
              <h3>Teams</h3>
              <div className="price">Custom</div>
              <p>Upskill your team with analytics and ML</p>
              <ul>
                <li>Team dashboards</li>
                <li>Custom tracks</li>
                <li>Dedicated support</li>
                <li>Progress analytics</li>
              </ul>
              <Link to="/signup" className="secondary-button">Contact Sales</Link>
            </motion.div>
          </motion.div>
        </div>
      </section>

      {/* CTA Section */}
      <section className="cta-section">
        <div className="section-container">
          <motion.div 
            className="cta-card"
            initial={{ opacity: 0, scale: 0.95 }}
            whileInView={{ opacity: 1, scale: 1 }}
            transition={{ duration: 0.6 }}
            viewport={{ once: true }}
          >
            <h2>Ready to start your data science journey?</h2>
            <p>Join thousands of learners who've accelerated their careers with our platform</p>
            <div className="cta-buttons">
              <Link to="/signup" className="primary-button">Get Started</Link>
              <Link to="/home" className="outline-button">Explore Paths</Link>
            </div>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default LandingPage;
